import React from 'react';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const Introduction = () => {
	return (
		<div>
			<Grid container direction='column' alignItems='center' className='border'>
				<Grid item container direction='row' alignItems='center' justify='center'>
					<Grid item xs={6}>
						<h2>کارفرما</h2>
						<h3>پروژه تابپت رو ثبت کن</h3>
						<h3>از بین پیشنهاد ها، تایپیست مورد نظر رو انتخاب کن</h3>
						<h3>هزینه‌ش رو پرداخت کن و نسخه ی تایپ شده‌ش رو تحویل بگیر</h3>
					</Grid>
				</Grid>
				<Grid item>
					<Button variant='outlined' size='medium' color='primary' startIcon={<ExpandMoreIcon />}>
						بیشتر
					</Button>
				</Grid>
			</Grid>
		</div>
	);
};

export default Introduction;
